INSERT INTO `recetas` VALUES (1,'Galleta de Chocolate',50,100,3.5,10,'Preparar masa con base de cacao.\n\nAñadir chispas de chocolate oscuro y chocolate con leche.\n\nFormar bolas medianas.\n\nHornear hasta que el centro esté suave.\n\nDejar enfriar para que endurezcan.','',1),(2,'Galleta de Vainilla',45,100,3,9,'None','',1),(3,'Galleta de Choco nuez',40,100,20,35,'Batir mantequilla y azúcar, luego añadir huevos.\n\nAgregar cacao y harina tamizada.\n\nIncorporar trozos de nuez.\n\nFormar las galletas con cuchara.\n\nHornear hasta que el borde esté firme y el centro suave.','',1),(4,'Galleta Oreo',40,100,15,25,'Triturar galletas Oreo y mezclarlas con la masa base de vainilla.\n\nAgregar trozos de chocolate blanco.\n\nDar forma a las galletas y hornear.\n\nDecorar con más trocitos de Oreo por encima.','',1);
INSERT INTO `recetas` VALUES (5,'Galleta Red Velvet',40,100,10,20,'Mezclar mantequilla, azúcar, huevo y vainilla.\n\nAgregar cacao, colorante rojo y vinagre con bicarbonato.\n\nIncorporar harina con sal.\n\nFormar galletas y hornear hasta que estén ligeramente firmes.\n\nOpcional: decorar con chispas de chocolate blanco.','',1);
INSERT INTO `recetas` VALUES (6,'Galleta Arcoiris',40,100,15,25,'Incorporar el huevo y la vainilla: Agrega el huevo al tazón y bate hasta que esté completamente incorporado. Luego, añade el extracto de vainilla y mezcla bien.','',1),(7,'Galleta de Nutella',45,100,25,30,'Preparar una masa base de chocolate suave.\n\nFormar bolitas y hacer un hueco al centro.\n\nRellenar con Nutella fría.\n\nCerrar bien y hornear hasta que estén firmes.\n\nDecorar con un toque extra de Nutella encima al servir.','',1),(8,'Galleta Doble Chocolate',45,100,15,25,'Preparar masa con base de cacao.\n\nAñadir chispas de chocolate oscuro y chocolate con leche.\n\nFormar bolas medianas.\n\nHornear hasta que el centro esté suave.\n\nDejar enfriar para que endurezcan.','',1),(9,'Galleta Canela',40,100,15,20,'Preparar masa tipo galleta de azúcar.\n\nAñadir canela molida a la mezcla.\n\nFormar bolas y pasarlas por una mezcla de azúcar con canela.\n\nHornear hasta que estén agrietadas y suaves.\n\nDejar enfriar en rejilla.','',1),(10,'Especial',40,100,25,35,'Precalentar el horno y preparar la bandeja: Precalienta tu horno a 180°C (350°F). Cubre una o varias bandejas para hornear con papel pergamino (papel de hornear). Esto evitará que las galletas se peguen.','',1);
/*!40000 ALTER TABLE `recetas` ENABLE KEYS */;
UNLOCK TABLES;

